      <div className="d-flex userDetails ps-2 flex-column">
        <div className="d-flex justify-content-between border_user pb-1">
          <div className="d-flex flex-column">
            <h4>Vansham</h4>
            <p className="m-0">member for 22 days</p>
          </div>
          <div className="d-flex">
